import * as React from "react";
import {
    Tabs,
    Tab,
    withStyles,
    Grid,
    Card,
    Paper,
    Popper
} from "@material-ui/core";
import ImageMagnifier from './ImageMagnifier';
import PropTypes from 'prop-types';


const styles = theme => ({
    tabs: {
        border: 'none',
        padding: '5px'
    },
    tab: {
        borderRadius: '10px',
        margin: '5px',
        width: '80px',
        minWidth: '0px',
        height: '80px'
    }
});

const items = [
    { pathName: "data:image/jpeg;base64,", label: "Test 1" },
    { pathName: "data:image/jpeg;base64,", label: "Test 2" },
    { pathName: "data:image/jpeg;base64,", label: "Test 3" }
];


function TabPanel(props) {
    const { children, value, index, ...other } = props;

    return (
        <div
            role="tabpanel"
            hidden={value !== index}
            id={`simple-tabpanel-${index}`}
            aria-labelledby={`simple-tab-${index}`}
            {...other}
        >
            {value === index && (
                <div> {children}</div>
            )}
        </div>
    );
}

TabPanel.propTypes = {
    children: PropTypes.node,
    index: PropTypes.any.isRequired,
    value: PropTypes.any.isRequired,
};

function a11yProps(index) {
    return {
        id: `simple-tab-${index}`,
        'aria-controls': `simple-tabpanel-${index}`,
    };
}

class ImageGallery extends React.Component {
    state = {
        value: 0,
        open: false,
        anchorEl: null
    };

    handleMenuOpen = (index, event) => {
        const { currentTarget } = event;
        this.setState({
            open: !this.state.open,
            anchorEl: currentTarget,
            value: index
        });
        console.log("currentTarget", currentTarget);
        console.log("value", this.value);
    };


    render() {
        const { classes } = this.props;
        const { anchorEl, open } = this.state;
        console.log("value", this.value);

        return (
            <div className={classes.root}>
                <Grid container spacing={3}>
                    <Grid item md={3}>
                        <Tabs
                            className={classes.tabs}
                            orientation="vertical"
                            value={this.state.value}
                            indicatorColor="primary"
                            textColor="primary"
                        >
                            {items.map((item, index) => (
                                <Card className={classes.tab}>
                                    <Tab
                                        key={index}
                                        onMouseOver={this.handleMenuOpen.bind(this, index)}
                                        data-key={index}
                                        classes={{ root: classes.tabItem }}
                                        icon={<img src={item.pathName} className={{ height: '80px' }} />}
                                        aria-owns={open ? "menu-list-grow" : undefined}
                                        aria-haspopup={"true"}
                                        {...a11yProps(index)}
                                    />
                                </Card>
                            ))}
                        </Tabs>
                    </Grid>
                    <Grid item md={9}>
                        <Popper open={open} anchorEl={anchorEl} id="menu-list-grow">
                            <Paper>
                                {items.map((item, index) => (
                                    <TabPanel value={item} index={index} key={index} onClick={this.handleMenuClose}>
                                        <ImageMagnifier data={item.pathName} />
                                    </TabPanel>
                                ))}
                            </Paper>
                        </Popper>
                    </Grid>
                </Grid>
            </div>
        );
    }
}

export default withStyles(styles)(ImageGallery);
